svg.script:
var link = document.querySelector('.link');
link.addEventListener('mouseenter', function(e) {
  document.getElementById('arrow').classList.remove('arrow-leave');
  document.getElementById('arrow').classList.add('arrow');
});  

link.addEventListener('mouseleave', function(e) {
  document.getElementById('arrow').classList.remove('arrow');
  document.getElementById('arrow').classList.add('arrow-leave');
});
